import styled from "styled-components";

export const WorkConteiner = styled.div`
  background: #0c0c0c;
  margin-top: 16vh;
  display: flex;
  flex-direction: column;
  justify-content: center;
  height: 103vh;
  z-index: 1;
  overflow: hidden;
`;
